You now have a running database and you can log in with mysql. However, the database will allow anyone to log in and change anything, which is not what you want - especially not on a production machine. Most distributions come with a mysql_secure_installation script that prompts you for a database root password and sets up accounts. We are going to do a similar thing, but with a custom setup for our purposes. Run mysql -u root. This should log you in as root without any authentication, which explains why I am making such a fuss about security! Quit again by typing Control+D. Run mysql -u root -e 'source /vagrant/secure-setup.sql. The -e command means "run the following command line argument as a script", as you know already from sed and several other tools; source means "load a file and run it" and the file in question is part of the lab package I have prepared for you. Run mysql -u root again. This time, it will not let you in, which is what we want. The secure-setup script is as follows: UPDATE mysql.user SET Password=PASSWORD('BA/458cR-5p.') WHERE User='root';
DELETE FROM mysql.user WHERE User='';
DELETE FROM mysql.user WHERE User='root' AND Host NOT IN ('localhost', '127.0.0.1', '::1');
DROP DATABASE IF EXISTS test;
DELETE FROM mysql.db WHERE Db='test' OR Db='test\\_%';
FLUSH PRIVILEGES; The first line sets a root password, and also shows the absolute minimum standard for a password: 12 characters, mix of uppercase, lowercase and symbols, random-ish. This is the password that you will be using to log in as root to your database on the VM, but of course you can change it if you want to. Type mysql -u root -p on the command line and press Enter. -p means "if a password is needed, prompt for one". You will be asked for the root password, type it in (without the quotes) and you should be let back in to the database. Once you are in, if you'd like to, you can use the first command from the secure-setup script to set a new password of your own. The next two lines remove some default users: one with the empty username, and all versions of root that let you log in over the network. The only versions of root that still exist are now "localhost" (e.g. from the same machine), 127.0.0.1 (same thing but using IPV4 notation) and "::1" (same in IPv6). This means that now, if your VM is connected to the internet, you cannot log in as root remotely at all, even with the password, which is the correct attitude to security. To administer a database, you should always first log in to the machine via ssh using a key file, then log in to the database from the machine itself. Next in the setup script, we remove the default test database and user. Finally, FLUSH PRIVILEGES updates the in-memory cache of the users table, making your new permissions take effect. Note: what happens when you install the mariadb package (or install it from a ZIP file) depends on the distribution. For some distributions, installing the package automatically creates a database, and adds the server to the default runlevel. Alpine will not do any of these things for you - you have to configure it itself, which is a good opportunity to learn what's going on behind the scenes in other distributions. Most distributions will not, however, configure the security settings automatically - some of them prompt for a root password at installation, but typically leave the test database and let root login remotely. Wherever you install mariadb or mysql, please check this yourself - an unsecured database is something that hackers will be keeping an eye out for.
